DROP TABLE IF EXISTS armorsets;
CREATE TABLE armorsets (
 id int(3) NOT NULL,
 chest int NOT NULL,
 legs varchar(20) default NULL,
 head varchar(20) default NULL,
 gloves varchar(20) default NULL,
 feet varchar(20) default NULL,
 skill_id varchar(20) NOT NULL default '0-1',
 shield varchar(20) default NULL,
 shield_skill_id varchar(20) NOT NULL default '0-1',
 enchant6skill varchar(20) NOT NULL default '0-1',
 PRIMARY KEY (id,chest)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

